  `ib_delete_state` varchar(2) NOT NULL DEFAULT '0' COMMENT '彻底删除位（0未删除 1已删除）',
  `ib_read_state` varchar(2) NOT NULL DEFAULT '0' COMMENT '已读标志位（0 未读 1已读）',
  `ib_mark_state` varchar(2) NOT NULL DEFAULT '0' COMMENT '标记标志位（0未标记 1已标记）',
  `ib_date` varchar(32) DEFAULT NULL COMMENT '时期',
  PRIMARY KEY (`t_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

